import React from "react";
import * as s from "./styled-header";
import { icons } from "../../assets";

export default () => {
  return (
    <s.MainHeader>
      <s.HeaderContent>
        <s.Logo src={icons.logo} alt="instaRocket" />
        <s.Logo src={icons.camera} alt="Enviar publicação" />
      </s.HeaderContent>
    </s.MainHeader>
  );
};
